// src/components/About.jsx
import { Container, Typography, Grid, Box, Card } from "@mui/material";
import { motion } from "framer-motion";

// Animation Variants
const containerVariants = {
  hidden: {},
  visible: {
    transition: {
      staggerChildren: 0.2,
    },
  },
};

const fadeSlide = {
  hidden: { opacity: 0, y: 40 },
  visible: { opacity: 1, y: 0, transition: { duration: 0.8, ease: "easeOut" } },
};

const imageHover = {
  hover: { scale: 1.05 },
};

const floatAnim = {
  animate: {
    y: [0, -10, 0],
    transition: { duration: 4, repeat: Infinity, ease: "easeInOut" },
  },
};

const sections = [
  {
    title: "Who We Are",
    desc: "PhysioTattva is a leading physiotherapy and rehabilitation centre committed to restoring movement and enhancing quality of life. We deliver evidence-based treatments supported by advanced technology and modern rehabilitation techniques. Our focus is on personalised care, accurate diagnosis, and effective therapy to help patients recover safely and regain confidence in movement.",
    images: [
      "https://images.unsplash.com/photo-1550831107-1553da8c8464?auto=format&fit=crop&w=900&q=80",
      "https://images.unsplash.com/photo-1580281657521-6c5d3c1b9c92?auto=format&fit=crop&w=900&q=80",
      "https://images.unsplash.com/photo-1579154204601-01588f351e67?auto=format&fit=crop&w=900&q=80",
    ],
  },
  {
    title: "Our Clinics & Treatment",
    desc: "PhysioTattva clinics are designed with state-of-the-art infrastructure and modern rehabilitation equipment to support effective care. We focus on personalized treatment plans tailored to individual needs, ensuring faster, safer recovery while improving mobility, strength, and overall wellbeing.",
    images: [
      "https://images.unsplash.com/photo-1606813902919-9f0c3a67c8fa?auto=format&fit=crop&w=900&q=80",
      "https://images.unsplash.com/photo-1579154204601-01588f351e67?auto=format&fit=crop&w=900&q=80",
      "https://images.unsplash.com/photo-1550831107-1553da8c8464?auto=format&fit=crop&w=900&q=80",
    ],
  },
];

export default function About() {
  return (
    <Box sx={{ bgcolor: "#f5f7fa", py: 10 }}>
      <Container>

        {/* Heading */}
        <motion.div
          initial="hidden"
          whileInView="visible"
          variants={fadeSlide}
        >
          <Typography variant="h3" textAlign="center" fontWeight="bold" gutterBottom>
            About PhysioTattva
          </Typography>
          <Typography
            variant="h6"
            textAlign="center"
            color="text.secondary"
            sx={{ mb: 8, maxWidth: 900, mx: "auto" }}
          >
            PhysioTattva is a holistic physiotherapy and rehabilitation centre dedicated to healing through science, care, and movement. We combine evidence based clinical practices with compassionate, patient centred treatment to restore strength, mobility, and confidence. Our experienced physiotherapists assess the root cause of pain and design personalised therapy plans for faster, safer recovery. From injury management and post surgery rehabilitation to chronic pain relief and preventive care, we support every stage of healing. At PhysioTattva, we believe movement is medicine, education empowers patients, and consistent guidance leads to long term wellness, independence, and improved quality of life for holistic recovery and wellbeing.
          </Typography>
        </motion.div>

        {/* Sections */}
        {sections.map((item, index) => (
          <motion.div
            key={index}
            variants={containerVariants}
            initial="hidden"
            whileInView="visible"
          >
            <Grid
              container
              spacing={5}
              alignItems="center"
              sx={{ mb: 10 }}
              direction={index % 2 === 0 ? "row" : "row-reverse"}
            >
              {/* Images */}
              <Grid item xs={12} md={6}>
                <Grid container spacing={3}>
                  {item.images.map((img, i) => (
                    <Grid item xs={12} key={i}>
                      <motion.div
                        variants={fadeSlide}
                        whileHover="hover"
                        animate="animate"
                      >
                        <Card
                          component={motion.div}
                          variants={imageHover}
                          sx={{
                            overflow: "hidden",
                            borderRadius: 4,
                            boxShadow: "0 15px 40px rgba(0,0,0,0.15)",
                          }}
                        >
                          <motion.img
                            src={img}
                            alt={`about-${i}`}
                            style={{
                              width: "100%",
                              height: "300px",
                              objectFit: "cover",
                            }}
                            variants={floatAnim}
                          />
                        </Card>
                      </motion.div>
                    </Grid>
                  ))}
                </Grid>
              </Grid>

              {/* Text */}
              <Grid item xs={12} md={6}>
                <motion.div variants={fadeSlide}>
                  <Typography variant="h4" fontWeight="bold" gutterBottom>
                    {item.title}
                  </Typography>
                  <Typography variant="body1" sx={{ fontSize: "1.1rem", lineHeight: 1.8 }}>
                    {item.desc}
                  </Typography>
                </motion.div>
              </Grid>
            </Grid>
          </motion.div>
        ))}

      </Container>
    </Box>
  );
}
